import React from "react";
import Category from "../CategoriesFilter/Category";

function PriceFilter() {
  const prices = [
    [0, 100],
    [100, 200],
    [200, 400],
    [400, 800],
    [800, 1600],
  ];
  return (
    <div>
      <ul>
        {prices.map((category, index) => (
          <li key={index}>
            <Category
              category={{ category: `${category[0]} - ${category[1]} $` }}
              subcategories={[]}
            />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PriceFilter;
